/* eslint-disable import/no-anonymous-default-export */
export default (props) =>{
    return(


<div class="row g-0">
  <div class="col-md-5">
    <img src={props.Foto} class="img-fluid rounded-start" alt="..."/>
  </div>
  <div class="col-md-8">

      <h5 class="card-title">Passeio Pra Toda Familia!!!!</h5>
      <p class="card-text">T is a little bit longer.</p>
     
    </div><br></br>
  </div>

    );
    }
